  false,\n\t\"url\": null,\n\t\"notes\": \"LiDAR data was acquired for the U.S. Army
  Corps of Engineers (USACE), Mobile District in September-October 2005 along the
  coastline of Hancock, Harrison, Jackson counties in Mississippi and Mobile County
  in Alabama from the land water interface (shoreline) to the north Right of Way of
  Interstate-10. The LiDAR DEM was delivered as first return, last return, bare earth,
  and water delivery in LAS format. Contract Number: W91278-04-D-0001/0003 EN. Project
  Number: C-05-054. Contractor: R&M Consultants, Inc., Anchorage, AK. Subcontractor:
  Woolpert, Inc., Dayton, OH.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
